import React from 'react';

export default function Skills() {
  return (
    <section id="skills" data-aos="fade-up">
      <h2>Skills</h2>
      <ul>
        <li>HTML, CSS, JavaScript</li>
        <li>Bootstrap, Node.js, MongoDB</li>
        <li>Java (Learning)</li>
      </ul>
    </section>
  );
}
